<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Windows-style Interface</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: Arial, sans-serif;
            overflow: hidden;
            /* Hide scrollbar of body */
            background-image: linear-gradient(to bottom,
                    rgba(0, 0, 0, 0.8),
                    rgba(0, 0, 0, 0.8)), url("https://i.imghippo.com/files/nYunp1707857311.png");
            background-size: cover;
            background-position: center;
            background-attachment: fixed;
            color: #fff;
            /* Light text color */
        }

        .window {
            position: absolute;
            background-color: #333;
            /* Dark window background color */
            border: 1px solid #666;
            /* Dark window border color */
            box-shadow: 2px 2px 5px rgba(255, 255, 255, 0.1);
            /* Light box shadow */
            overflow: hidden;
            z-index: 100;
        }

        .sidebar {
            width: 300px;
            height: 90vh;
            top: 0;
            left: 0;
            overflow-y: auto;
            padding: 10px;
            resize: both;
        }

        .camera-list-item {
            word-wrap: break-word;
            max-width: 100%;
            margin-bottom: 5px;
            padding: 5px;
            background-color: #3f6238;
            /* Button background color */
            border: 1px solid #ccc;
            /* Button border */
            border-radius: 5px;
            /* Rounded corners */
            cursor: pointer;
            /* Cursor on hover */
            transition: background-color 0.3s ease;
            /* Smooth transition on hover */
            color: #000;
            /* Light text color */
        }

        .camera-list-item:hover {
            background-color: #e1e174;
            /* Button background color on hover */
            color: #000;
            /* Light text color */
        }

        .video-container {
            resize: both;
            overflow: auto;
        }

        .window-titlebar {
            background-color: #222;
            /* Dark titlebar background color */
            padding: 5px;
            cursor: move;
            display: flex;
            justify-content: space-between;
        }

        #windowTitlebar {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            z-index: 1000;
            /* Ensure the titlebar stays above other content */
        }

        .close-button {
            background-color: transparent;
            border: none;
            color: #ccc;
            /* Light close button color */
            cursor: pointer;
            font-size: 14px;
        }

        .close-button:hover {
            color: #fff;
            /* Light close button color on hover */
        }

        .ip-info {
            padding: 10px;
            background-color: #444;
            /* Dark info background color */
            border-top: 1px solid #999;
            /* Dark info border color */
            font-size: 12px;
        }

        #addIpInput {
            width: 200px;
            margin-bottom: 10px;
        }

        #addIpButton {
            padding: 5px 10px;
            background-color: #007bff;
            /* Light button background color */
            color: #fff;
            /* Light button text color */
            border: none;
            border-radius: 3px;
            cursor: pointer;
        }

        #addIpButton:hover {
            background-color: #0056b3;
            /* Light button background color on hover */
        }

        /* CSS */
        .button-89 {
            --b: 3px;
            --s: .45em;
            --color: #a9a9a9;

            padding: calc(.5em + var(--s)) calc(.9em + var(--s));
            color: var(--color);
            --_p: var(--s);
            background:
                conic-gradient(from 90deg at var(--b) var(--b), #0000 90deg, var(--color) 0) var(--_p) var(--_p)/calc(100% - var(--b) - 2*var(--_p)) calc(100% - var(--b) - 2*var(--_p));
            transition: .3s linear, color 0s, background-color 0s;
            outline: var(--b) solid #0000;
            outline-offset: .6em;
            font-size: 16px;

            border: 0;

            user-select: none;
            -webkit-user-select: none;
            touch-action: manipulation;
        }

        .button-89:hover,
        .button-89:focus-visible {
            --_p: 0px;
            outline-color: var(--color);
            outline-offset: .05em;
        }

        .button-89:active {
            background: var(--color);
            color: #fff;
        }

        .button-29 {
            align-items: center;
            appearance: none;
            background-image: radial-gradient(100% 100% at 100% 0, #5adaff 0, #5468ff 100%);
            border: 0;
            border-radius: 6px;
            box-shadow: rgba(45, 35, 66, .4) 0 2px 4px, rgba(45, 35, 66, .3) 0 7px 13px -3px, rgba(58, 65, 111, .5) 0 -3px 0 inset;
            box-sizing: border-box;
            color: #fff;
            cursor: pointer;
            display: inline-flex;
            font-family: "JetBrains Mono", monospace;
            height: 30px;
            justify-content: center;
            line-height: 1;
            list-style: none;
            overflow: hidden;
            padding-left: 16px;
            padding-right: 16px;
            position: relative;
            text-align: left;
            text-decoration: none;
            transition: box-shadow .15s, transform .15s;
            user-select: none;
            -webkit-user-select: none;
            touch-action: manipulation;
            white-space: nowrap;
            will-change: box-shadow, transform;
            font-size: 18px;
        }

        .button-29:focus {
            box-shadow: #3c4fe0 0 0 0 1.5px inset, rgba(45, 35, 66, .4) 0 2px 4px, rgba(45, 35, 66, .3) 0 7px 13px -3px, #3c4fe0 0 -3px 0 inset;
        }

        .button-29:hover {
            box-shadow: rgba(45, 35, 66, .4) 0 4px 8px, rgba(45, 35, 66, .3) 0 7px 13px -3px, #3c4fe0 0 -3px 0 inset;
            transform: translateY(-2px);
        }

        .button-29:active {
            box-shadow: #3c4fe0 0 3px 7px inset;
            transform: translateY(2px);
        }
    </style>
</head>

<body>
    <div class="container">
        <div class="window sidebar" id="sidebar">
            <div class="window-titlebar">Online IP Cameras</div>
            <div class="window-content">
                <form id="addIpForm">
                    <input type="text" id="addIpInput" placeholder="Enter IP address">
                    <button type="submit" id="addIpButton">Add IP</button>
                </form>
                <ul class="camera-list" id="cameraList">
                    <!-- Online RTSP IP addresses will be inserted here dynamically -->
                </ul>
            </div>
        </div>
    </div>
